jQuery(window).scroll(function () {
    if (jQuery('#post_article').length) {
        var startTop = jQuery('#post_article').offset().top;
        var endTop = jQuery('#footer').offset().top;
        if ((jQuery(document).scrollTop() > startTop) && (jQuery(document).scrollTop() < endTop)) {
            jQuery('.article_socialicons').addClass('fixed_tab');
        } else {
            jQuery('.article_socialicons').removeClass('fixed_tab');
        }


        var ah2 = jQuery('.sidesignup').outerHeight();
        //	alert(ah2);
        var startTop = jQuery('#signupclear').offset().top;
        var endTop2 = jQuery('#footer').offset().top - ah2 - 120;

        if ((jQuery(document).scrollTop() > startTop) && (jQuery(document).scrollTop() < endTop2)) {
            jQuery('.sidesignup').addClass('fixed_tab');
        } else {
            jQuery('.sidesignup').removeClass('fixed_tab');
        }

    }

});

